import React from 'react';
import homeImg from '../assets/images/home.png';   


export default function Home() {
  return (
    <div>
      <h1>Добро пожаловать</h1>
      <img src={homeImg} alt="Home page design" style={{ maxWidth: '100%', height: 'auto' }} />
    </div>
  );
}
